        //     console.log(res);
        //     setPost(res.data);
        // })
        // .catch(err =>{
        //     console.log(err);
        // })
        getUser
    , []);
    return (
        <div>
            <ul>
                {
                    post.map((ele)=>{
                        return (
                            <li key ={ele.id}>
                                {ele.title}
                            </li>
                        )
                    })
                }   
            </ul>
        </div>
    )
}
